                "query1,2023-10-01T10:02:00",
                "query3,2023-10-01T10:03:00",
                "query2,2023-10-01T10:04:00"
        ));

        JavaRDD<String> topFrequentQueries = jsc.parallelize(Arrays.asList(
                "query1",
                "query2"
        ));

        // Broadcast the top frequent queries
        Broadcast<Set<String>> topQueriesBroadcast = jsc.broadcast(new HashSet<>(topFrequentQueries.collect()));

        // Process the onsite attributed data
        Map<String, Long> cache = new HashMap<>();
        long totalRequests = 0;
        long cacheHits = 0;

        for (String record : onsiteAttributedData.collect()) {
            String[] parts = record.split(",");
            String query = parts[0];
            String timestamp = parts[1];

            totalRequests++;

            if (topQueriesBroadcast.value().contains(query)) {
                if (cache.containsKey(query)) {
                    // Cache hit
                    cacheHits++;
                } else {
                    // Cache miss
                    cache.put(query, System.currentTimeMillis() + 12 * 60 * 60 * 1000); // Cache for 12 hours
                }
            }
        }

        // Calculate hit rate
