To create a Tooltip component in Next.js using React Context that closes the previously opened Tooltip, you can follow these steps:

1. **Create a Context for managing Tooltip state.**
2. **Create a Tooltip Provider to wrap your application.**
3. **Create the Tooltip component itself.**
4. **Use the Tooltip component in your application.**

Here's a step-by-step implementation:

### 1. Create a Context for managing Tooltip state

First, create a context to manage the state of the Tooltip. This context will keep track of the currently open Tooltip and provide methods to open and close Tooltips.

```jsx
// context/TooltipContext.js
import React, { createContext, useState, useContext } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => {
  const context = useContext(TooltipContext);
  if (!context) {
    throw new Error('useTooltip must be used within a TooltipProvider');
  }
  return context;
};
```

### 2. Create a Tooltip Provider to wrap your application

Wrap your application with the `TooltipProvider` so that the Tooltip context is available throughout your app.

```jsx
// pages/_app.js
import { TooltipProvider } from '../context/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```

### 3. Create the Tooltip component itself

Now, create the `Tooltip` component. This component will use the context to manage its visibility.

```jsx
// components/Tooltip.js
import React, { useRef, useEffect } from 'react';
import { useTooltip } from '../context/TooltipContext';

const Tooltip = ({ id, children, content }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useTooltip();
  const tooltipRef = useRef(null);

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (tooltipRef.current && !tooltipRef.current.contains(event.target)) {
        closeTooltip();
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [closeTooltip]);

  const handleOpen = () => {
    openTooltip(id);
  };

  const handleClose = () => {
    closeTooltip();
  };

  const isOpen = activeTooltip === id;

  return (
    <div ref={tooltipRef} style={{ position: 'relative' }}>
      <div onClick={handleOpen}>{children}</div>
      {isOpen && (
        <div
          style={{
            position: 'absolute',
            top: '100%',
            left: '50%',
            transform: 'translateX(-50%)',
            background: 'black',
            color: 'white',
            padding: '8px',
            borderRadius: '4px',
            zIndex: 1000,
          }}
        >
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

