This works, but I'm wondering if there's a more efficient or cleaner way to handle the conditional classes in Tailwind CSS.

### Updated Solution

To make the code cleaner and more efficient, you can use the `classnames` library, which allows you to conditionally apply classes. Here's how you can update your component:

1. Install the `classnames` library:

```bash
npm install classnames
```

2. Update your `Layout` component to use `classnames`:

```jsx
import React from 'react';
import classNames from 'classnames';

const Layout = ({ children, variant }) => {
  const classes = classNames(
    'p-4',
    {
      'w-full': variant === 'full-width',
      'max-w-screen-lg mx-auto': variant === 'centered',
    }
  );

  return (
    <div className={classes}>
      {children}
    </div>
  );
};

export default Layout;
```

### Explanation

- **classNames**: This library allows you to conditionally apply classes by passing an object where the keys are the class names and the values are boolean expressions. If the value is `true`, the class is applied; otherwise, it is not.
- **p-4**: This class is always applied, providing padding to the layout.
- **w-full**: This class is applied if the `variant` is `full-width`.
- **max-w-screen-lg mx-auto**: This class is applied if the `variant` is `centered`.

This approach makes the code cleaner and more maintainable, especially if you have more variants or conditions

